import React from "react";
import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta
        avatar={
          <Avatar
            src="https://xsgames.co/randomusers/avatar.php?g=pixel"
            title="JongjuLee"
            description="This is the description"
          />
        }
      />
    </Card>
  );
};

export default UserProfile;
